import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import CreateAccount from './CreateAccount/CreateAccount';
import Login from './Login/Login';
import Home from './HomePage/Home';
import Logout from './LogOut/LogOut';
import PatientDash from './PatientDash/PatientDash';
import WorkerDash from './WorkerDash/WorkerDash';
import Notifications from './Notifications/Notifications';


function App() {
    return (
      <Router>
        <div className="App">
          <div className="content">
            <Routes>
              <Route exact path="/" element={<Home />}> </Route>
              <Route path="/createaccount" element={<CreateAccount />}></Route>
              <Route path="/login" element={<Login />}></Route>
              <Route path="/logout" element={<Logout />}></Route>
              <Route path="/patientdash" element={<PatientDash />}>
                <Routes>
                    <Route path="/notfications" element={<Notifications/>}></Route>
                </Routes>

              </Route>
              <Route path="/workerdash" element={<WorkerDash />}>


              </Route>
            </Routes>
          </div>
        </div>
      </Router>
    );
  }

  export default App;
